import React, { useState } from 'react';

const MusicUploadForm = () => {
    // State for file selection and upload progress
    const [selectedFile, setSelectedFile] = useState(null);
    const [uploadProgress, setUploadProgress] = useState(0);

    // Function to handle file selection
    const handleFileChange = (e) => {
        const file = e.target.files[0];
        setSelectedFile(file);
    };

    // Function to simulate file upload process
    const handleUpload = () => {
        // Simulate network latency
        setTimeout(() => {
            // Update upload progress
            setUploadProgress(100);
            // Print message to console
            console.log(`File "${selectedFile.name}" uploaded successfully!`);
            // Reset upload progress after 2 seconds
            setTimeout(() => {
                setUploadProgress(0);
            }, 2000);
        }, 2000);
    };

    return (
        <div className="music-upload-form">
            {/* File input */}
            <input type="file" onChange={handleFileChange} />
            {/* Display selected file name */}
            {selectedFile && <p>Selected File: {selectedFile.name}</p>}
            {/* Upload button */}
            <button onClick={handleUpload} disabled={!selectedFile}>Upload</button>
            {/* Progress indicator */}
            {uploadProgress > 0 && <progress value={uploadProgress} max="100" />}
        </div>
    );
};

export default MusicUploadForm;
